※マルニ(MARUNI)木工の全商品を取り扱っております。<br>
未掲載品もお気軽にお問い合わせください。<br>
TEL:03-3354-3201　Mail:rakuten@telshop.co.jp<br>

<div style="color:#333;">
<p><img src="http://www.rakuten.ne.jp/gold/tels/img/maruni/maruniLogo.gif" alt="マルニ木工ロゴ"/></p>

<div style="width:660px;">
<img src="http://www.rakuten.ne.jp/gold/tels/img/maruni/mediterraneanMain.jpg" alt="マルニ木工地中海" width="190px" height="190px" style="display:block;float:right;"/>
<p style="margin-top:0;background-color:#ddd;padding-left:10px;"><img src="http://www.rakuten.ne.jp/gold/tels/img/squareRed.jpg" alt="リストマーク(赤)" style="margin-right:5px;">地中海(MEDITERRANEAN)</p>
<p style="text-decoration:none;">地中海をめぐる国々の歴史が生んだ様式家具を現代に再現した「地中海」シリーズ。ディレクトワール様式を基調としたフランス風です。この様式は、ルイ16世から続く古代ギリシャローマ文明に再スポットを当てた「ネオクラシック」スタイル。より直線を効かせたフランストラディショナルの優美で洗練された小粋なスタイルで、サイズや機能性にも配慮したすっきりと洗練されたシリーズです。暖かみのある塗色で仕上げた自然な木の味わいがゆったりと寛げるインテリアを作り上げる地中海シリーズ。各部に手間を掛けた加工を施し、家具本来の手技による温もりを感じさせます。</p>
</div>
<p style="width:200px;border:1px solid #333;padding:5px;">お得な会員価格は<a href="http://item.rakuten.co.jp/tels/10032258zz/">こちら</a>！</p><style type="text/css">
